export default {
  name: 'StLink',
  props: {
    value: {
      type: String,
      default: ''
    },

    /**
     * 可以把普通的文本理解为超链接的禁用状态
     */
    disabled: {
      type: [Boolean],
      default: false
    },
    maxWidth: {
      type: String,
      default: '1000px'
    },
    to: {
      type: [Object, null],
      default: null
    }
  },
  bem: {
    b: 'st-link'
  },
  methods: {
    onClick: function onClick() {
      if (this.disabled) {
        return;
      }

      if (this.to) {
        this.$router.push(this.to);
      }

      this.$emit('click');
    }
  }
};
